import itertools

def is_prime(n):
    def check_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    for p in itertools.permutations(str(n)):
        p = int(''.join(p))
        if check_prime(p):
            return True
    return False

