from collections import Counter

def solve():
    n = int(input())
    a = list(map(int, input().split()))
    even = Counter()
    odd = Counter()
    for num in a:
        if num % 2 == 0:
            even[num] += 1
        else:
            odd[num] += 1
    for num in sorted(even.keys()):
        if even[num]!= 0:
            for num2 in sorted(odd.keys()):
                if odd[num2]!= 0:
                    if num <= num2:
                        return "YES"
                    else:
                        return "NO"
    return "NO"

