import heapq

def solve():
    t = int(input())
    for _ in range(t):
        n = int(input())
        nails = []
        for _ in range(n):
            a, b = map(int, input().split())
            nails.append((a, b))
        nails.sort(key=lambda x: x[0])
        min_heap = []
        for i in range(n):
            heapq.heappush(min_heap, (nails[i][1], i))
        count = 0
        while min_heap:
            length, index = heapq.heappop(min_heap)
            if nails[index][0] >= length:
                count += 1
                if index < n - 1:
                    heapq.heappush(min_heap, (nails[index + 1][1], index + 1))
        print(count)

