from sys import stdin, stdout

def solve():
    n = int(input())
    s = input().strip()
    graph = defaultdict(set)
    for i in range(n - 1):
        graph[s[i]].add(s[i + 1])
        graph[s[i + 1]].add(s[i])
    visited = set()
    count = 0
    for node in graph:
        if node not in visited:
            stack = [node]
            visited.add(node)
            while stack:
                curr = stack.pop()
                for neighbor in graph[curr]:
                    if neighbor not in visited:
                        visited.add(neighbor)
                        stack.append(neighbor)
            count += 1
    stdout.write(str(count) + '\n')

