import heapq

def solve():
    n, m = map(int, input().split())
    p = list(map(int, input().split()))
    pq = []
    ans = [0] * n
    for i in range(m):
        if p[i] <= n:
            heapq.heappush(pq, (-i, p[i]))
        else:
            if pq:
                _, x = heapq.heappop(pq)
                ans[x - 1] = i + 1
                heapq.heappush(pq, (-i, p[i]))
    for i in range(n):
        if not pq:
            ans[i] = -1
    print(*ans)

