def solve():
    n = int(input())
    a = list(map(int, input().split()))
    max_heap = []
    min_heap = []
    for i in range(n):
        heapq.heappush(max_heap, (-a[i], i))
        heapq.heappush(min_heap, (a[i], i))
    max_val = -heapq.heappop(max_heap)[0]
    min_val = heapq.heappop(min_heap)[0]
    for i in range(n):
        if a[i] == max_val:
            print(-heapq.heappop(max_heap)[0] - max_val, end=' ')
        elif a[i] == min_val:
            print(max_val - min_val, end=' ')
        else:
            print(max(max_val - a[i], a[i] - min_val), end=' ')
    print()

