import heapq

def solve():
    n, k = map(int, input().split())
    a = list(map(int, input().split()))
    a = [0] + a
    max_heap = [0] * k
    for i in range(1, k + 1):
        max_heap[i % k] = a[i]
    for i in range(k + 1, n + 1):
        if a[i] > max_heap[i % k]:
            max_heap[i % k] = a[i]
            heapq.heapify(max_heap)
    return sum(max_heap)

