import heapq

def solve():
    t = int(input())
    for _ in range(t):
        n, m = map(int, input().split())
        a = list(map(int, input().split()))
        pq = []
        for i in range(n):
            heapq.heappush(pq, (a[i], i, m + 1 - a[i]))
        s = ['B'] * m
        for _ in range(m):
            if pq:
                _, i, j = heapq.heappop(pq)
                if i < m:
                    s[i] = 'A'
                if j < m:
                    s[j] = 'A'
        print(''.join(s))

